import ExpenseItem from "./ExpenseItem";
import './Expenses.css';
export default function Expenses(Props){
  
  
  return (
    <div className="expenses">
      <ExpenseItem title={Props.arr.expenses[0].title} amount={Props.arr.expenses[0].amount} date={Props.arr.expenses[0].date}/>
      <ExpenseItem title={Props.arr.expenses[1].title} amount={Props.arr.expenses[1].amount} date={Props.arr.expenses[1].date}/>
      <ExpenseItem title={Props.arr.expenses[2].title} amount={Props.arr.expenses[2].amount} date={Props.arr.expenses[2].date}/>
      <ExpenseItem title={Props.arr.expenses[3].title} amount={Props.arr.expenses[3].amount} date={Props.arr.expenses[3].date}/>
    </div>
  )

}
